CREATE TABLE IF NOT EXISTS country1 (
    `country_id` INT,
    `alpha2Code` VARCHAR(2) CHARACTER SET utf8,
    `alpha3Code` VARCHAR(3) CHARACTER SET utf8,
    `altSpellings` VARCHAR(176) CHARACTER SET utf8,
    `area` NUMERIC(10, 2),
    `borders` VARCHAR(105) CHARACTER SET utf8,
    `callingCodes` VARCHAR(24) CHARACTER SET utf8,
    `capital` VARCHAR(19) CHARACTER SET utf8,
    `cioc` VARCHAR(3) CHARACTER SET utf8,
    `currencies` VARCHAR(507) CHARACTER SET utf8,
    `demonym` VARCHAR(45) CHARACTER SET utf8,
    `flag` VARCHAR(37) CHARACTER SET utf8,
    `gini` NUMERIC(3, 1),
    `languages` VARCHAR(847) CHARACTER SET utf8,
    `latlng` VARCHAR(29) CHARACTER SET utf8,
    `name` VARCHAR(52) CHARACTER SET utf8,
    `nativeName` VARCHAR(58) CHARACTER SET utf8,
    `numericCode` NUMERIC(4, 1),
    `population` INT,
    `region` VARCHAR(8) CHARACTER SET utf8,
    `regionalBlocs` VARCHAR(423) CHARACTER SET utf8,
    `subregion` VARCHAR(25) CHARACTER SET utf8,
    `timezones` VARCHAR(156) CHARACTER SET utf8,
    `topLevelDomain` VARCHAR(21) CHARACTER SET utf8,
    `translations` VARCHAR(489) CHARACTER SET utf8,
    PRIMARY KEY (country_id)
);
